The main command to run architects.

In an `architect` section of each project in [`angular.json`](../angular-json) you can define build configurations.

An architect can contain any number of builds. A build defines name of builder, base options and any number of configurations.

```json
{
  ...
  "projects": {
    "app": {
      ...
      "architect": {
        "build": {
          "builder": "@angular-devkit/build-angular:browser",
          "options": {
            ...
          },
          "configurations": {
            "production": {
              ...
            },
            ...
          }
        },
        ...
```

## Configuration

List of default builders and their options you can find in the section [Builders](../builders).

These options defined in `options` and `configurations` sections of `angular.json`.

On `ng run` call you can override any builder's option:

```
ng run [project]:[target] --[argument]=[value]
```

```
ng run [project]:[target] [--[argument]=[value]]
ng run [project]:[target]:[configuration] [--[argument]=[value]]
```

Основная команда для запуска различных билдов.

В секции `architect` каждого проекта [`angular.json`](../angular-json) распологаются настройки билдов. 

Количество билдов может быть любое, для каждого указывается имя билдера (`builder`), базовые настройки (`options`) и любое количество конфигураций (`configurations`) к нему.

```json
{
  ...
  "projects": {
    "app": {
      ...
      "architect": {
        "build": {
          "builder": "@angular-devkit/build-angular:browser",
          "options": {
            ...
          },
          "configurations": {
            "production": {
              ...
            },
            ...
          }
        },
        ...
```


## Настройки

Со списком настроек стандартных билдеров вы можете ознакомиться в секции [Builders](../builders).

Эти настройки указываются в разделе `options` и `configurations` файла `angular.json`.

При вызове команды `ng run` вы можете переобьявить любую настройку билдера с помощью агрументов командой строки:

```
ng run [project]:[target] --[argument]=[value]
```
